Code cleanup! response interceptors have been deprecated for some time, and it
is confusing to have two APIs, one of which is slightly "hidden" and hard to
see, which perform the same task. The newer API is a bit cleaner and more
visible, so this is naturally preferred.

BREAKING CHANGE:

Previously, it was possible to register a response interceptor like so:

```js
// register the interceptor as a service
$provide.factory('myHttpInterceptor', function($q, dependency1,
  dependency2) {
  return function(promise) {
    return promise.then(function(response) {
      // do something on success
      return response;
    }, function(response) {
      // do something on error
      if (canRecover(response)) {
        return responseOrNewPromise
      }
      return $q.reject(response);
    });
  }
});

$httpProvider.responseInterceptors.push('myHttpInterceptor');
```
Now, one must use the newer API introduced in v1.1.4 (4ae46814), like so:

```js
$provide.factory('myHttpInterceptor', function($q) {
  return {
    response: function(response) {
      // do something on success
      return response;
    },
    responseError: function(response) {
      // do something on error
      if (canRecover(response)) {
        return responseOrNewPromise
      }
      return $q.reject(response);
    }
  };
});

$httpProvider.interceptors.push('myHttpInterceptor');
```
Closes #7266

This change ensures that a module's config blocks are always invoked after all of its providers are registered.

NOTE: I'm not entirely sure if this is desirable yet, because the point mentioned in the BREAKING CHANGE section below may actually be something which is desirable. However, I do feel it is probably better to always invoke config blocks for a single module after all of its providers. The config blocks should not play a role in how providers are registered, in my own opinion.

BREAKING CHANGE:

Previously, config blocks would be able to control behaviour of provider registration, due to being invoked prior to provider registration. Now, provider registration always occurs prior to configuration for a given module, and therefore config blocks are not able to have any control over a providers 
registration.

Example:

Previously, the following:

```js
   angular.module('foo', [])
    .provider('$rootProvider', function() {
      this.$get = function() { ... }
    })
    .config(function($rootProvider) {
      $rootProvider.dependentMode = "B";
    })
    .provider('$dependentProvider', function($rootProvider) {
      if ($rootProvider.dependentMode === "A") {
        this.$get = function() {
          // Special mode!
        }
      } else {
        this.$get = function() {
          // something else
        }
      }
    });
```

would have "worked", meaning behaviour of the config block between the registration of "$rootProvider" and "$dependentProvider" would have actually accomplished something and changed the behaviour of the app. This is no longer possible within a single module.

Fixes #7139

This modifies the injector to prevent automatic annotation from occurring for
a given injector.

This behaviour can be enabled when bootstrapping the application by using the
attribute
"ng-strict-di" on the root element (the element containing "ng-app"), or
alternatively by passing an object with the property "strictDi" set to "true"
in angular.bootstrap, when bootstrapping manually.

JS example:

    angular.module("name", ["dependencies", "otherdeps"])
     .provider("$willBreak", function() {
       this.$get = function($rootScope) {
       };
     })
     .run(["$willBreak", function($willBreak) {
       // This block will never run because the noMagic flag was set to true,
       // and the $willBreak '$get' function does not have an explicit
       // annotation.
     }]);

    angular.bootstrap(document, ["name"], {
     strictDi: true
   });

HTML:

    <html ng-app="name" ng-strict-di>
     <!-- ... -->
   </html>

This will only affect functions with an arity greater than 0, and without an
$inject property.

Closes #6719 Closes #6717 Closes #4504 Closes #6069 Closes #3611
